import bcrypt from 'bcrypt'
import client from "../../client";

export default {
	Mutation: {
		createAccount: async (_, {firstName, lastName, username, email, password}) => {
			try {
				const existingUser = await client.user.findFirst({
					where: {
						OR: [{username}, {email}]
					}
				});

				if (existingUser) {
					return {
						ok: false,
						error: "exist User"
					}
				}

