				const result = await client.user.create({
					data: {
						username, email, firstName, lastName, password: uglyPassword
					}
				});

				console.log(result, 'result');

				return {
					ok: true
				}
			} catch (e) {
				return {
					ok: false,
					error: JSON.stringify(e)
				}
			}
		}
	}
}

